import React from 'react';

import burgerLogo from '../../../assets/Images/burger-logo.png';
import '../Logo/Logo.css';

const logo = (props) => (
    <div className='Logo' style={height= props.height}>
        <img src={burgerLogo} alt='MyBurger' />
    </div>
);

export default logo;
